<!DOCTYPE html>
<html>

<head>
  <meta charset="utf-8">

  <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
  <meta http-equiv="pragma" content="no-cache">
  <meta http-equiv="Cache-Control" content="no-cache, must-revalidate">
  <meta http-equiv="expires" content="0">
  <link rel="icon" href="<%= BASE_URL %>favicon.ico">
  <title>
    <%= webpackConfig.name %>
  </title>

  <script language="JavaScript" src="<%= BASE_URL %>word/word.js"></script>

  <link rel="stylesheet" href="<%= BASE_URL %>cheditor/contents.css">
  <link rel="stylesheet" href="<%= BASE_URL %>cheditor/skins/moono-lisa/editor.css">
  <link rel="stylesheet" href="<%= BASE_URL %>cheditor/plugins/scayt/dialogs/styles/dialog.css">
  <link rel="stylesheet" href="<%= BASE_URL %>cheditor/plugins/scayt/skins/moono-lisa/scayt.css">
  <link rel="stylesheet" href="<%= BASE_URL %>cheditor/plugins/wsc/skins/moono-lisa/wsc.css">
  <link rel="stylesheet" href="<%= BASE_URL %>cheditor/plugins/tableselection/styles/tableselection.css">
  <script src="<%= BASE_URL %>cheditor/ckeditor.js"></script>
  <script src="<%= BASE_URL %>cheditor/config.js"></script>
  <script src="<%= BASE_URL %>cheditor/styles.js"></script>
  <script src="<%= BASE_URL %>cheditor/zh-cn.js"></script>
  <script src="<%= BASE_URL %>cheditor/plugins/pastetools/filter/common.js"></script>
  <script src="<%= BASE_URL %>cheditor/plugins/pastefromword/filter/default.js"></script>

</head>

<body>
  <noscript>
    <strong>We're sorry but <%= webpackConfig.name %> doesn't work properly without JavaScript enabled. Please enable it
        to continue.</strong>
  </noscript>
  <div id="app"></div>
  <!-- built files will be auto injected -->
</body>
<script language="JavaScript" src="<%= BASE_URL %>fish/lib/jquery3.3.1.js"></script>
<script language="JavaScript" src="<%= BASE_URL %>fish/lib/jtopo-0.4.8-min.js"></script>
<script language="JavaScript" src="<%= BASE_URL %>fish/lib/MakFishBone.js"></script>
<script language="JavaScript" src="<%= BASE_URL %>fish/lib/toolbar.js"></script>

</html>
